import React, { Component } from 'react'
import './Complete.css'

export default class Complete extends Component {
  render() {
    return (
      <div className='complete'>
        <input type='checkbox'></input>&nbsp;&nbsp;&nbsp;
        已完成<span>0</span> / 全部<span>3</span>
      </div>
    )
  }
}
